import { createTheme } from '@material-ui/core/styles';

const theme = createTheme({
   typography: {
    "fontFamily": `"Nunito", "Helvetica", "Arial", sans-serif`
    // "fontSize": 14,
    // "fontWeightLight": 300,
    // "fontWeightRegular": 400,
    // "fontWeightMedium": 500
   }
});

export default theme;
